import React from 'react';

const VideoList = ({ videos }) => {
    console.info('VideoList');
    console.log(videos);
    const resultVideos = videos.mao(video => {
        return (
            <div>{video.id}</div>
        );
    });

    return (
        <div className='container'>
            <div className='row'>
                <div className='col'>
                    {resultVideos}
                </div>
            </div>
        </div>
    );
}

export default VideoList;
